import cn from "./Buttons.module.scss";

export const Buttons = () => {
  return (
    <div>
      <button className={cn.cybrBtn}>
        Cyber<span>_</span>
        <span className={cn.cybrBtn__glitch}>Cyber_</span>
        <span aria-hidden className={cn.cybrBtn__tag}>
          R25
        </span>
      </button>
      <button class={cn.cybrBtn}>
        Buttons<span>_</span>
        <span className={cn.cybrBtn__glitch}>Buttons_</span>
        <span className={cn.cybrBtn__tag}>R25</span>
      </button>
    </div>
  );
};
